import React from 'react';

const Greeting = (props) => {

	const { pendingSum } = props

	props.pendingSum === null ? props.pendingSum = 0 : pendingSum

	return (
		<div>
		  <div className='f3'>
		    {`${props.name}, your account ballance is ...`}
		  </div>
		  <div>
		  	{`Pending ${pendingSum} Actual ${props.sum}`}
		  </div>
		</div>
	);
}

export default Greeting;
